import logo from "./logo.svg";
import "./App.css";
import Layout from "./components/shared/layout";
import { Route, Routes } from "react-router-dom";
import Home from "./Pages/Home";
 
function App() {
  return (
    <>
      <Layout>
        <Routes>
          <Route path="/" element={<Home />}></Route>
        </Routes>
      </Layout>
    </>
  );
}
 
export default App;
